import React, { Component } from "react";
import { Row, Col } from "antd";

export default class Intro extends Component {
  render() {
    return (
      <>
        <Row
          type="flex"
          justify="center"
          align="middle"
          style={{ minHeight: "30vh", flexDirection: "column" }}
        >
          <Row>
            <Col>
              <h1 style={{fontFamily:"Poppins-Regular"}}>DL 1961</h1>
            </Col>
          </Row>
        </Row>
        <Row
          type="flex"
          justify="center"
          align="middle"
          style={{ minHeight: "100vh", flexDirection: "column" }}
        >
          <Row>
            <Col>
              <h1>DIGITAG_PROGRAM</h1>
            </Col>
          </Row>
        </Row>
      </>
    );
  }
}
